import React from 'react';
import './styles.css';

const Header = () => (
  <header className='home-header'>
<div class="nav">

<div class="div-btn">
    <ul>
        <li class="resim"><h1>Tekno<span style="color:red">Blog</span></h1></li>
        <li><a  class="aktif" href="#">Anasayfa</a></li>
        <li><a  href="#">Giriş</a></li>
        <li><a href="#">Hakkında</a></li>


    </ul>
</div>
</div>
  </header>
);

export default Header;
